import React, { useState, useEffect, useCallback } from "react";

function CustomerList(props) {

    const [posts, setPosts] = useState([]);
    const history = useHistory();

    useEffect(() => {
        getPosts();
    }, []);

    // get posts
    const getPosts = () => {
        axios
        .get("https://jsonplaceholder.typicode.com/posts")
        .then((response) => {
            if (response.status === 200) {
            setPosts(response?.data);
            }
        })
        .catch((error) => {
            console.log(error);
        });
    };


    return (
        <>
            <div className="content-wrapper">
                <section className="content-header">
                    <h1>Add New Customer</h1>
                </section>
                <section class="content">
                    <div class="row">
                        <div class="col-xs-12">
                            <div class="box">
                                <div class="box-header">
                                    <h3 class="box-title"> Customer List</h3>
                                </div>
                                <div class="box-body">
                                    <a href="#"><button class="btn btn-success"><i class="glyphicon glyphicon-plus"></i> Add Customer</button></a>
                                    <button class="btn btn-default" onClick="reload_table()"><i class="glyphicon glyphicon-refresh"></i> Reload</button>
                                    <br />
                                    <br />
                                    <table id="table" class="table table-bordered table-hover">
                                        <thead>
                                            <tr>
                                                <th width="10%">Sr. No </th>
                                                <th width="40%">Name</th>
                                                <th width="10%">Contact No.</th>
                                                <th width="10%">City</th>
                                                <th width="10%">Balance</th>
                                            </tr>
                                        </thead>
                                        <tbody>


                                            <h1> API calls with React Hooks </h1>
                                            {isLoading && <p>Wait I'm Loading comments for you</p>}

                                            {commitHistory.length !== 0 && (
                                                <button onClick={loadMoreCommit}>Load More Commits</button>
                                            )}


                                            {commitHistory.map((c, index) => (
                                                <div key={index}>
                                                    <>
                                                        <tr><td>{user.customerName}</td></tr>
                                                        <tr><td>{user.mobno}</td></tr>
                                                        <tr><td>{user.city}</td></tr>
                                                        <tr><td>{user.totalOutBal}</td></tr>
                                                    </>
                                                </div>
                                            ))}









                                        {isLoading ? (
                                            <h1>Loading...</h1>
                                            ) : (
                                                data.map((user) => (
                                                <>
                                                    <tr><td>{user.customerName}</td></tr>
                                                    <tr><td>{user.mobno}</td></tr>
                                                    <tr><td>{user.city}</td></tr>
                                                    <tr><td>{user.totalOutBal}</td></tr>
                                                </>
                                                ))
                                            )}

                                       
                                                    
                                               
                                        </tbody>
                                    </table>
                                </div>
                            </div>
                        </div>
                    </div>
                </section>
            </div>
        </>
    );
}

export default CustomerList;
